function fmt(n: number) {
  const s = parseFloat(n.toFixed(5)).toString();
  return (s.startsWith('0.') || s.startsWith('-0.')) ? s.replace('0.', '.') : s;
}

export function getOldFractals() {
  return oldFractalData.join('\n').split('\n').filter(s=>s).map((line) => {
    const [timestr, data] = line.split(' : ');
    const time = new Date(timestr?.split('#')[1] ?? "");
    const forms = data?.replaceAll(',','#').split('#').map((form) => {
      const nums = form.split(' ');
      nums[6] = '1';
      return nums.map((n) => fmt(parseFloat(n))).join(' ');
    });
    return { createdAt: time, form: forms?.join(';')??'', color: "0 000000;1 FFFFFF"}
  });
}
